import React, { Component } from 'react'
import { PageHeader } from 'antd';
export default class PageHeaders extends Component {
    render() {
        return (
            <div>
                <PageHeader
                    className="site-page-header"
                    onBack={() => null}
                    title="Title"
                    subTitle="This is a subtitle"
                />
            </div>
        )
    }
}
